import React from 'react';
import ReactDOM from 'react-dom';
import CommentDetail from './CommentDetail';

const comments = [
  { author: 'Tooty', time: 'Today at 6:00PM', text: 'Nice blog post' },
  { author: 'Sam', time: 'Today at 7:00PM', text: 'It\'s pretty gross' },
  { author: 'Haribo', time: 'Today at 8:00PM', text: 'Where are you' },
];

ReactDOM.render(
  <div className="ui container comments">
    {comments.map(post => <CommentDetail author={post.author} time={post.author} text={post.author} />)}

  </div>,
  document.querySelector('#root'),
);
